import React from 'react'
import './Services.css'
import HeartEmoji from "../../img/heartemoji.png";
import Glasses from "../../img/glasses.png";
import Humble from "../../img/humble.png";
import Card from '../Card/Card';


const Services = () => {
  return (
    <div className="services">
        {/* left side */}
        <div className="awesome">



        <div className="blur s-blur1" style = {{background:"#ABF11FF94"}}></div>
        </div>
        {/* right side */}
        <div className="cards">

            {/* first card */}
            <div style={{left: '30rem'}}>
                <Card
                emoji = {HeartEmoji}
                heading = {'Design'}
                detail = {"Figma, Sketch, Photoshop"}
                />
            </div>

            {/* Second card */}
            <div style={{top: '12rem',left: "-4rem"}}>
                <Card
                emoji = {Glasses}
                heading = {'Machine Learning Engineer'}
                detail = {"HTML, JAVA, CSS"}
                />
            </div>

            {/* Third card */}
            <div style={{top: '19rem',left: "14rem"}}>
                <Card
                emoji = {Glasses}
                heading = {'Machine Learning Engineer'}
                detail = {"HTML, JAVA, CSS"}
                />
            </div>


        </div>

    </div>
  )
}

export default Services
